function App() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        padding: "25px",
        flexWrap: "wrap-reverse",
      }}
    >
      <Modal />
      <Modal />
      <Modal />
      <Modal />
    </div>
  );
}

export default App;
